import React from 'react';

interface OutputLayerProps {
    outputShape?: number[];
    activationFunction?: string;
}

const OutputLayer: React.FC<OutputLayerProps> = ({ 
    outputShape = [10], 
    activationFunction = 'softmax' 
}) => {
    return (
        <div style={{ userSelect: 'none' }}>
            <h4 style={{ 
                margin: 0, 
                fontSize: 16, 
                color: '#ffffff', 
                userSelect: 'none',
                fontWeight: 600,
                textShadow: '0 1px 2px rgba(0, 0, 0, 0.3)'
            }}>Output Layer</h4>
            <div style={{ 
                fontSize: 13, 
                color: '#b0b8c4', 
                userSelect: 'none',
                marginTop: 6,
                background: 'rgba(255, 255, 255, 0.05)',
                padding: '6px 10px',
                borderRadius: 8,
                border: '1px solid rgba(255, 255, 255, 0.1)'
            }}>
                <div style={{ marginBottom: 4 }}>Shape: [{outputShape.join(', ')}]</div>
                <div>Activation: <span style={{ color: '#b5ffb5' }}>{activationFunction}</span></div>
            </div>
        </div>
    );
};

export default OutputLayer;
